import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [users, setUsers] = useState([
    { id: 1, age: 30, name: "송중기" },
    { id: 2, age: 24, name: "송강" },
    { id: 3, age: 21, name: "김유정" },
    { id: 4, age: 29, name: "구교환" },
  ]);
  const newFunc = users.map(function (item) {
    return (
      <div key={item.id} className="square-Style">
        {item.age}-{item.name}
      </div>
    );
  });
  return <div className="style">{newFunc}</div>;
};

export default App;

